import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a product card to open product detail
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for product detail modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail.png'));

    // Click the "Add to Wish List" button
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });
    await page.click('.add-to-wishlist');

    // Wait for success notification
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_added.png'));

    // Extract wishlist data from localStorage to verify addition
    const wishlistData = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonWishlist') || '[]');
    });

    return {
      success: true,
      action: "Added product to wishlist successfully",
      extractedData: {
        wishlistCount: wishlistData.length,
        productAdded: wishlistData.length > 0 ? wishlistData[0].title : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
